geregisseerd door Ben Wheatley
met Neil Maskell, Michael Smiley en MyAnna Buring

Jay, een ex-soldaat die nu een huurmoordenaar is, is fysiek en mentaal getekend na een rampzalige klus in Kiev. Het is nu acht maanden later en hij wordt onder druk gezet door zijn partner Gal om een nieuwe opdracht aan te nemen. Wanneer ze dieper binnendringen in de donkere en vreemde wereld van de nieuwe opdracht, krijgt Jay weer last van zijn paranoia en angst...



